      content: >
        [color=#1b67a5]█▄ █ ▀█▀ [head=3]Federation Trade Notice[/head] █ ▀█     █     [color=red]

        This document is binding[/color][/color]


        [color=black]

        To the appointed keeper of the [b]Hammer & Halberd[/b] shuttle, hear these words of the Dwarven Federation of Traders.  

        Your vessel is not merely a market, but a roaming hall of craft and tradition. When you open its gates upon the Station, you represent the sweat of our forges and the honor of our clans.  


        Keep your weapon racks ordered, that no blade lie about like scrap. Speak to customers as a merchant of steel, not as a peddler of trinkets. Let no coin buy a dwarven sword too cheaply, for every edge is born of hammer and fire.  


        Guard your stock with vigilance, for many soft-handed stationers will seek to "test" what is not theirs. A careless merchant shames the Guild as much as a cracked blade.  


        Remember above all: the Hammer & Halberd is to smell of oiled steel, to echo with the clang of dwarven craft, and to remind all aboard the station that our people trade with dignity. Profit fills the till, but pride fills the beard.  


        Signed and sealed under the authority of the Dwarven Federation of Traders.  

        ⚒

        [/color]
