        [color=red]This document concerns customers[/color][/color]


        [color=black]

        To all who set foot upon the [b]Hammer & Halberd[/b] shuttle, take heed:  

        You enter a dwarven hall of trade, not a common bazaar. Respect the craft, respect the merchant, and you shall find arms and armor of quality unmatched by station fabrication.  


        Do not draw steel without leave, nor brandish a weapon as jest. Every blade here is honed for war, not play. Testing wares without purchase marks you as thief in the eyes of the Guild.  


        Coin is the language of trade. Haggle if you must, but speak plain, and do not insult the worth of dwarven work. A sword bought here carries not only weight of iron, but weight of heritage.  


        Remember well: within these walls you are guest to the Federation. Treat the stock with care, pay fair price, and leave with both weapon and honor intact.  


        By decree of the Dwarven Federation of Traders.  

        ⚒

        [/color]
